/****** Object:  StoredProcedure [dbo].[SP_01]    Script Date: 7/4/2021 10:27:32 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		<Author,,Name>
-- Create date: <Create Date,,>
-- Description:	<Description,,>
-- =============================================
CREATE PROCEDURE [dbo].[SP_01]
AS
BEGIN
	Update [dbo].[UserDetails] set [Upass]=CONCAT([Uname],[Password])

	INSERT INTO [dbo].[User_con] ([L_name])
	SELECT [Uname]
	FROM [dbo].[UserDetails]
	WHERE [Type]='lecture'

	INSERT INTO [dbo].[User_con] ([S_name])
	SELECT [Uname]
	FROM [dbo].[UserDetails]
	WHERE [Type]='student'
END
GO
